import React from 'react';
import { Link } from 'react-router-dom';
import { Sidenav, Nav, Divider } from 'rsuite';

const panelStyles = {}
const Sidebar = () => {
  return (
    <div style={{ width: 250 }}>
      <Sidenav defaultOpenKeys={['3', '4']} activeKey="1">
        <Sidenav.Body>
          <Nav>

          </Nav>
        </Sidenav.Body>
      </Sidenav>
    </div>
  )
}

export default Sidebar;
